INSERT INTO `answer` VALUES ('6721', '5', '326', '39', '10', '4', '使用过程中并无不适应，口服味道不错、像果汁。外用精华清爽不油腻，用了一段时间 斑点好像是有点点淡了，希望坚持用下来能让斑点消失 。总体使用感受愉快。但愿还能有幸参与各种活动，在wellady的帮助下变得越来越美，期待wellady其它产品！祝愿wellady越来越好，造福于广大消费者', '1', '2018-10-27 14:53:44');
INSERT INTO `answer` VALUES ('6722', '5', '326', '40', '11', '4', '很幸运得到免费试用的机会，收到产品的那一刻惊呆了，这哪是试用装？这明明就是正装啊。满满的感受到了wellady的诚意。产品使用感良好，口服味道甜甜的像果汁、包装也很上档次。外用方便携带，一次一点点精华就够抹全脸了。用了一段时间，斑点是有点淡化了呢。希望还能那么幸运参与wellady其它活动、在wellady的帮助下变美、祝愿wellady越来越好，造福于更多的消费者', '1', '2018-10-27 14:53:44');
